import React from 'react';
import teamllogo from "../Images/team.png"
const Team = () => {
  return (
    <>
        <div className='tl'>
            <img src={teamllogo} alt="logo of team" />
        </div>
      <div>
      <img src={teamllogo} alt="logo of team" />
        <p></p>
      </div>
    </>
  );
}

export default Team;
